	add("obligation", "{\"term\":\"obligation\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\"], \"text\":\"From Old french (842-ca. 1400) \u0027obligacion\u0027 from Latin \u0027obligatio\u0027, from \u0027obligatum\u0027 (past participle of \u0027obligare\u0027), from ob- \u0027to\u0027 + ligare \u0027to bind\u0027, from Proto-indo-european {{m|ine-pro|*leig-||to bind}}.\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The act of binding oneself by a social, legal, or moral tie to someone\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"A social, legal, or moral requirement, duty, contract, or promise that compels someone to follow or avoid a particular course of action\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A course of action imposed by society, law, or conscience by which someone is bound or restricted\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"A legal agreement stipulating a specified payment or action; the document containing such agreement\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"X shall be entitled to subcontract its \u0027\u0027obligation\u0027\u0027 to provide the Support Services.\u0027 \u0026lt;nowiki\u0026gt;\u0026lt;\u0026lt;from an agreement\u0026gt;\u0026gt;\u0026lt;/nowiki\u0026gt\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1668\u0027\u0027 December 19, w:James Dalrymple, 1st Viscount of James Dalrymple, “\u0027Mr.\u0027 Alexander Seaton \u0027contra\u0027 Menzies” in \u0027The Deciſions of the Lords of Council \u0026amp; Seſſion\u0027 I (Edinburgh, 1683), \u0026lt;span class\u003d\u0026quot;plainlinks\u0026quot;\u0026gt;[http://books.google.co.uk/books?id\u003d7ApBAAAAcAAJ\u0026amp;pg\u003dPA575\u0026amp;dq\u003d%22correi%22\u0026amp;hl\u003den\u0026amp;sa\u003dX\u0026amp;ei\u003d2GcCT_z-LsWq8QOGtv2yAQ\u0026amp;ved\u003d0CDMQ6AEwA\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"v\u003donepage\u0026amp;q\u003d%22correi%22\u0026amp;f\u003dfalse page 575]\u0026lt;/span\u0026gt\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"The Pupil after his Pupillarity, had granted a Diſcharge to one of the Co-tutors, which did extinguiſh the whole Debt of that Co-tutor, and conſequently of all the reſt, they being all \u0027correi debendi\u0027, lyable by one individual \u0027\u0027Obligation\u0027\u0027, which cannot be Diſcharged as to one, and ſtand as to all the reſt\", \"priority\":8}]}, \"synonyms\":{}}");

