	add("obliquity", "{\"term\":\"obliquity\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"middle french (ca. 1400-1600)\", \"Latin\"], \"text\":\"From Middle french (ca. 1400-1600) \u0027lang\u003dfrm\u0027 from Latin \u0027lang\u003dla\u0027 from \u0027lang\u003dla|obliquus\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The quality of being oblique in direction, deviating from the horizontal or vertical; the angle created by such a deviation\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1667\u0027\u0027, John Milton, \u0027Paradise Lost\u0027, lines 766-769\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"The Planet Earth, so stedfast though she seem, / Insensibly three different Motions move? / Which else to several Sphears thou must ascribe, / Mov\u0027d contrarie with thwart \u0027\u0027obliquities\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"1851\u0027\u0027, w:Herman Herman Melville, \u0027w:Moby Moby Dick\u0027, s:Moby-Dick/Chapter chapter\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"Screwed at its axis against the side, a swinging lamp slightly oscillates in Jonah’s room; and the ship, heeling over towards the wharf with the weight of the last bales received, the lamp, flame and all, though in slight motion, still maintains a permanent \u0027\u0027obliquity\u0027\u0027 with reference to the room; though, in truth, infallibly straight itself, it but made obvious the false, lying levels among which it hung\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"1897\u0027\u0027, Henry James, \u0027What Maisie Knew\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"She wore glasses which, in humble reference to a divergent \u0027\u0027obliquity\u0027\u0027 of vision, she called her straighteners, and a little ugly snuff-coloured dress trimmed with satin bands in the form of scallops and glazed with antiquity\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"Mental or moral deviation or perversity; immorality\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"1924\u0027\u0027, Herman Melville, \u0027Billy Budd\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dtext\u0026amp;offset\u003d475338594\u0026amp;textreg\u003d2\u0026amp;query\u003dobliquities\u0026amp;id\u003dMelBill Chapter 2\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"Habitually living with the elements and knowing little more of the land than as a beach, or, rather, that portion of the terraqueous globe providentially set apart for dance-houses, doxies and tapsters, in short what sailors call a \u0026quot;fiddlers\u0027-green,\u0026quot; his simple nature remained unsophisticated by those moral \u0027\u0027obliquities\u0027\u0027 which are not in every case incompatible with that manufacturable thing known as respectability\", \"priority\":10},{\"upperType\":\"NOUN\", \"text\":\"2006\u0027\u0027, Thomas Pynchon, \u0027Against the Day\u0027, Vintage 2007, p. 404\", \"priority\":11},{\"upperType\":\"NOUN\", \"text\":\"Stray\u0027s [friends], apt to keep more to the shadows, tended to be practitioners of \u0027\u0027obliquity\u0027\u0027—as it quite often came down to, varieties of pimp\", \"priority\":12},{\"upperType\":\"NOUN\", \"text\":\"The quality of being obscure, oftentimes willfully, sometimes as an exercise in euphemism\", \"priority\":13},{\"upperType\":\"NOUN\", \"text\":\"1879\u0027\u0027, Mark Twain, \u0027A Tramp Abroad\u0027, [http://etext.virginia.edu/etcbin/ot2www-pubeng?specfile\u003d/texts/english/modeng/publicsearch/modengpub.o2w\u0026amp;act\u003dtext\u0026amp;offset\u003d644798885\u0026amp;textreg\u003d2\u0026amp;query\u003dobliquities\u0026amp;id\u003dTwaTram Chapter 25\", \"priority\":14},{\"upperType\":\"NOUN\", \"text\":\"That spiked my gun. I could not say anything. I was entirely out of verbal \u0027\u0027obliquities\u0027\u0027; to go further would be to lie, and that I would not do; so I simply sat still and suffered , -- sat mutely and resignedly there, and sizzled, -- for I was being slowly fried to death in my own blushes\", \"priority\":15}]}, \"synonyms\":{}}");

