	add("oblivion", "{\"term\":\"oblivion\", \"etymology\":{\"influencers\":[], \"languages\":[\"English\", \"old french (842-ca. 1400)\", \"Latin\", \"anglo-norman\"], \"text\":\"From Anglo-norman \u0027oblivion\u0027 ( \u003d Old french (842-ca. 1400) \u0027oblivion\u0027 , from Latin {{m|la|oblīviō||forgetfulness}}, from \u0027lang\u003dla|oblivisci\u0027 ()\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The state of forgetfulness or distraction; fig. confuse\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"The state of being completely forgotten\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"A state of permanent unconsciousness existing after death; A state of nonexistence or nothingnes\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"He found him in a desert land, in the oblivion, a howling wilderness\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"a wasteland; a supernatural realm of waste, like hel\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"I will cast them into oblivion\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"Close shut the gates of oblivion\", \"priority\":7}]}, \"synonyms\":{}}");

