	add("obloquy", "{\"term\":\"obloquy\", \"etymology\":{\"influencers\":[{}], \"languages\":[\"English\", \"Latin\"], \"text\":\"From \u0027obloquium\u0027 (contradiction) from Latin \u0027obloquor\u0027 (speak against, contradict)\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"Abusive language\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"1748\u0027\u0027, David Hume, Enquiries concerning the human understanding and concerning the principles of moral.\u0027 London: Oxford University Press, 1973. § 34\", \"priority\":2},{\"upperType\":\"NOUN\", \"text\":\"It is surprising, therefore, that this philosophy, which, in almost every instance, must be harmless and innocent, should be the subject of so much groundless reproach and \u0027\u0027obloquy\", \"priority\":3},{\"upperType\":\"NOUN\", \"text\":\"Disgrace suffered from abusive language\", \"priority\":4},{\"upperType\":\"NOUN\", \"text\":\"1825\u0027\u0027, William Hazlitt, \u0027The Spirit of the Age\u0027, s:The Spirit of the Age/Mr. Mr. Malthu\", \"priority\":5},{\"upperType\":\"NOUN\", \"text\":\"His name undoubtedly stands very high in the present age, and will in all probability go down to posterity with more or less of renown or \u0027\u0027obloquy\", \"priority\":6},{\"upperType\":\"NOUN\", \"text\":\"1886\u0027\u0027, w:Henry Henry James, \u0027The Princess Casamassima\", \"priority\":7},{\"upperType\":\"NOUN\", \"text\":\"It was comparatively easy for him to accept himself as the son of a terribly light Frenchwoman; there seemed a deeper \u0027\u0027obloquy\u0027\u0027 even than that in his having for his other parent a nobleman altogether wanting in nobleness\", \"priority\":8},{\"upperType\":\"NOUN\", \"text\":\"A false accusation; malevolent rumors\", \"priority\":9},{\"upperType\":\"NOUN\", \"text\":\"It is as cruel as the grave to any man, when he knows his own rectitude of conduct, to have his hard services not only debased and underrated. But the Revolutionary soldiers are not the only people that endure \u0027\u0027obloquy\", \"priority\":10}]}, \"synonyms\":{}}");

